import React, {useEffect, useState} from "react";
import axios from "axios";
import {API_URL} from "../index";







function Test() {
    const [data, setData] = useState([])

    useEffect(()=>{
        getStudents()
    },[])

    const getStudents = (data)=>{
        axios.get(API_URL).then(data => setData(data.data))
    }

    const resetState = () => {
        getStudents();
    };
    return (
        <h1>10</h1>
    );
}

export default Test;
